import styles from './NavBar.module.css'

const NavBar = () => {
  const handlerScrollToAction = () => {
    window.scrollTo(0, 25 + 75 + 25 + 525 + 25)
  }

  const handlerScrollToAdress = () => {
    window.scrollTo(0, 25 + 75 + 25 + 525 + 25 + +400 + 1600)
  }

  return (
    <nav className={styles.NavBar}>
      <div className={styles.logo}>
        All<span style={{ color: '#fff' }}>GYM</span>
      </div>
      <div className={styles.menu}>
        <ul>
          <li onClick={handlerScrollToAction} style={{ cursor }}>Услуги</li>
          <li onClick={handlerScrollToAdress}>Адрес и Контакты</li>
          <li style={{ color: 'red' }}>Тест-Драйв</li>
          <li>+7 (999) 000-00-00</li>
        </ul>
      </div>
    </nav>
  )
}

export default NavBar
